INSERT INTO `blogs` VALUES (3,'Al-Douri-Group-participated-in-Anuga-2019-3','Al Douri Group, participated in Anuga 2019','شاركت مجموعة الدوري في معرض أنوجا 2019arabic','<p>Al Douri Group is proud to announce its participation at Anuga 2019, one the world&rsquo;s largest trade fair for food and beverages. The food fair will take place from 5th &ndash; 9th October 2019 in Cologne and will welcome more than 7,000 exhibitors and about 165,000 visitors from 198 countries. In addition, this year Anuga celebrates its 100th anniversary!!!!!</p>','<p>تفتخر مجموعة الدوري بإعلان مشاركتها في معرض أنوجا 2019، أحد أكبر المعارض التجارية للأغذية والمشروبات في العالم. سيقام معرض الأغذية في الفترة من 5 إلى 9 أكتوبر 2019 في كولونيا وسيستقبل أكثر من 7000 عارض وحوالي 165000 زائر من 198 دولة. بالإضافة إلى ذلك، تحتفل أنوجا هذا العام بالذكرى المئوية لتأسيسها!!!!!!</p>','14',1,'2023-10-20','Meta Title 2019','Meta description 2019','OG Title 2019','OG Description 2019','Twitter Title 2019','Twitter Description 2019','Keywords 2019','14',NULL,NULL,'2024-02-20 16:22:45','2024-02-20 17:47:26');
/*!40000 ALTER TABLE `blogs` ENABLE KEYS */;
UNLOCK TABLES;

