INSERT INTO `page_translations` VALUES (8,9,'ae','Our Story','<span style=\"color: rgb(85, 85, 85); font-family: NeueMontreal-Regular; font-size: 16px;\">At Zena &amp; Kazena, we believe that every piece of jewelry tells a story, a narrative of elegance, luxury, and individuality. Founded with a passion for exceptional artistry, our brand has grown into a symbol of sophistication and quality. Each collection is crafted by award-winning designers and jewelers, blending timeless designs with modern aesthetics to create unique and cherished pieces.</span>',NULL,NULL,NULL,NULL,'Our Mission','<p><span style=\"color: rgb(85, 85, 85); font-family: NeueMontreal-Regular; font-size: 16px;\">Our mission is to redefine luxury jewelry by providing customers with exclusive, high-quality designs that celebrate life\'s special moments. From custom engagement rings to everyday elegance, Zena &amp; Kazena is committed to excellence, using only the finest materials and paying meticulous attention to detail in every piece.</span></p>','Why Choose Us?',NULL,NULL,'<ul style=\"padding-left: 1.5rem; color: rgb(85, 85, 85); font-size: 1rem; line-height: 1.6; font-family: NeueMontreal-Regular;\"><li><span style=\"font-weight: bolder;\">Exquisite Craftsmanship:</span>&nbsp;Our team of skilled artisans and gemologists ensures every piece is crafted to perfection.</li><li><span style=\"font-weight: bolder;\">Premium Quality:</span>&nbsp;We source the finest materials to create jewelry that stands the test of time.</li><li><span style=\"font-weight: bolder;\">Personalized Experience:</span>&nbsp;From custom designs to exclusive collections, our jewelry is made just for you.</li><li><span style=\"font-weight: bolder;\">Customer Satisfaction:</span>&nbsp;We are dedicated to providing a seamless, luxurious shopping experience with every purchase.</li></ul>','Our Collections','<p><span style=\"color: rgb(85, 85, 85); font-family: NeueMontreal-Regular; font-size: 16px;\">Discover a world of elegance with our exclusive collections. Each piece, from rings and earrings to necklaces and bracelets, is designed to complement the modern aesthetic while preserving the essence of timeless beauty. Our collections feature a blend of classic and contemporary designs, perfect for every occasion and personal style.</span></p>','<p><span style=\"color: rgb(85, 85, 85); font-family: NeueMontreal-Regular; font-size: 16px;\">At Zena &amp; Kazena, we are not just selling jewelry; we are building relationships. We are committed to delivering exceptional value and quality, backed by a team dedicated to providing unmatched customer support. We invite you to experience the luxury, artistry, and personal touch that make Zena &amp; Kazena a brand cherished by customers worldwide.</span></p>',NULL,'Our Commitment to You',NULL,NULL,NULL,NULL,NULL,'Meta Title ar about',NULL,NULL,'OG Title ar about',NULL,'Twitter Title ar about',NULL,NULL,'2024-11-19 18:15:11','2024-11-19 18:15:11'),(9,7,'en','Reach to us through ;','','',NULL,NULL,NULL,'','<p>PHONE : 8593962005</p><p>EMAIL : info@thegrostore.in</p>','','','','','','','','','zenakazena@yopmail.com','','','','','','','','','','<p>sddsd</p>','','',NULL,'2024-11-29 22:28:55','2025-09-04 13:53:26'),(10,10,'en','Mortgage','<p><span style=\"color: rgb(102, 102, 102); font-family: NeueMontreal-Regular; font-size: 18px; text-align: center;\">A mortgage is a loan used to purchase real estate, where the property itself serves as collateral. It allows buyers to finance the majority of the purchase price while making an initial down payment. Borrowers agree to repay the loan in regular installments over a set term, typically 15 to 30 years, with each payment including both principal and interest. Mortgages can have fixed or adjustable interest rates, influencing the total cost of the loan. If the borrower fails to meet the repayment obligations, the lender has the right to foreclose on the property. Mortgages are essential for most homebuyers, providing a practical way to own property without needing the full purchase price upfront.</span></p>',NULL,NULL,NULL,NULL,'How Mortgages Work','<p><span style=\"color: rgb(102, 102, 102); font-family: NeueMontreal-Regular; font-size: 18px; background-color: rgb(236, 236, 236);\">Individuals and businesses use mortgages to buy real estate without paying the entire purchase price upfront. The borrower repays the loan plus interest over a specified number of years until they own the property free and clear. Most traditional mortgages are fully amortized. This means that the regular payment amount will stay the same, but different proportions of principal vs. interest will be paid over the life of the loan with each payment. Typical mortgage terms are for 15 or 30 years, but some mortages can run for longer terms. Mortgages are also known as liens against property or claims on property. If the borrower stops paying the mortgage, the lender can foreclose on the property. For example, a residential homebuyer pledges their house to their lender, which then has a claim on the property. This ensures the lender’s interest in the property should the buyer default on their financial obligation. In the case of foreclosure, the lender may evict the residents, sell the property, and use the money from the sale to pay off the mortgage debt.</span></p>','The Mortgage Process','/storage/pages/1733577801_67544c49c3074.jpg','/storage/pages/1733577801_67544c49c6090.jpg','<p><span style=\"color: rgb(102, 102, 102); font-family: NeueMontreal-Regular; font-size: 18px; background-color: rgb(236, 236, 236);\">Would-be borrowers begin the process by applying to one or more mortgage lenders. The lender will ask for evidence that the borrower is capable of repaying the loan. This may include bank and investment statements, recent tax returns, and proof of current employment. The lender will generally run a credit check as well. If the application is approved, the lender will offer the borrower a loan of up to a certain amount and at a particular interest rate. Homebuyers can apply for a mortgage after they have chosen a property to buy or even while they are still shopping for one, thanks to a process known as pre-approval. Being pre-approved for a mortgage can give buyers an edge in a tight housing market because sellers will know that they have the money to back up their offer. Once a buyer and seller agree on the terms of their deal, they or their representatives will meet at what’s called a closing. This is when the borrower makes their down payment to the lender. The seller will transfer ownership of the property to the buyer and receive the agreed-upon sum of money, and the buyer will sign any remaining mortgage documents. The lender may charge fees for originating the loan (sometimes in the form of points) at the closing.</span></p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2024-12-07 16:19:13','2024-12-07 21:23:21'),(11,10,'ae','الرهن العقاري','<p>الرهن العقاري هو قرض يستخدم لشراء العقارات، حيث يعمل العقار نفسه كضمان. وهو يسمح للمشترين بتمويل غالبية سعر الشراء مع سداد دفعة أولى. ويوافق المقترضون على سداد القرض على أقساط منتظمة على مدى فترة محددة، عادة من 15 إلى 30 عامًا، مع كل دفعة تشمل كلًا من أصل القرض والفائدة. يمكن أن تكون أسعار الفائدة على الرهن العقاري ثابتة أو قابلة للتعديل، مما يؤثر على التكلفة الإجمالية للقرض. إذا فشل المقترض في الوفاء بالتزامات السداد، يحق للمقرض حجز العقار. الرهن العقاري ضروري لمعظم مشتري المنازل، حيث يوفر طريقة عملية لامتلاك العقارات دون الحاجة إلى دفع سعر الشراء بالكامل مقدمًا.</p>',NULL,NULL,NULL,NULL,'كيف تعمل الرهون العقارية','<p>يستخدم الأفراد والشركات الرهن العقاري لشراء العقارات دون دفع سعر الشراء بالكامل مقدمًا. يسدد المقترض القرض بالإضافة إلى الفائدة على مدى عدد محدد من السنوات حتى يمتلك العقار خاليًا من الديون. يتم سداد معظم الرهن العقاري التقليدي بالكامل. وهذا يعني أن مبلغ الدفع المنتظم سيبقى كما هو، ولكن سيتم دفع نسب مختلفة من رأس المال مقابل الفائدة على مدار عمر القرض مع كل دفعة. تكون شروط الرهن العقاري النموذجية لمدة 15 أو 30 عامًا، ولكن بعض الرهن العقاري يمكن أن يستمر لفترات أطول. تُعرف الرهن العقاري أيضًا باسم الامتيازات على الممتلكات أو المطالبات على الممتلكات. إذا توقف المقترض عن سداد الرهن العقاري، فيمكن للمقرض حجز العقار. على سبيل المثال، يرهن مشتري المساكن منزله للمقرض، الذي يكون له بعد ذلك مطالبة على العقار. وهذا يضمن مصلحة المقرض في العقار في حالة تخلف المشتري عن سداد التزاماته المالية. في حالة الحجز العقاري، يجوز للمقرض طرد السكان وبيع العقار واستخدام الأموال من البيع لسداد دين الرهن العقاري.</p>','عملية الرهن العقاري','/storage/pages/1733577801_67544c49c3074.jpg','/storage/pages/1733577801_67544c49c6090.jpg','<p>يبدأ المقترضون المحتملون العملية بالتقدم إلى أحد أو أكثر من المقرضين العقاريين. سيطلب المقرض دليلاً على أن المقترض قادر على سداد القرض. قد يشمل ذلك البيانات المصرفية والاستثمارية، والإقرارات الضريبية الأخيرة، وإثبات العمل الحالي. سيقوم المقرض عمومًا بإجراء فحص ائتماني أيضًا. إذا تمت الموافقة على الطلب، فسيعرض المقرض على المقترض قرضًا يصل إلى مبلغ معين وبمعدل فائدة معين. يمكن لمشتري المنازل التقدم بطلب للحصول على قرض عقاري بعد اختيارهم للعقار الذي يشترونه أو حتى أثناء تسوقهم لشراء واحد، وذلك بفضل عملية تُعرف باسم الموافقة المسبقة. يمكن أن يمنح الحصول على الموافقة المسبقة على الرهن العقاري المشترين ميزة في سوق الإسكان الضيق لأن البائعين سيعرفون أن لديهم المال لدعم عرضهم. بمجرد أن يتفق المشتري والبائع على شروط صفقتهما، سيجتمعان أو ممثلوهما في ما يسمى بالإغلاق. هذا هو الوقت الذي يقوم فيه المقترض بدفع دفعته المقدمة للمقرض. يقوم البائع بنقل ملكية العقار إلى المشتري ويحصل على المبلغ المتفق عليه من المال، ويقوم المشتري بالتوقيع على أي مستندات رهن عقاري متبقية. قد يفرض المقرض رسومًا مقابل إصدار القرض (أحيانًا في شكل نقاط) عند الإغلاق.</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2024-12-07 16:32:52','2024-12-07 16:32:52'),(12,11,'en','Sales','<p><span style=\"font-family: \"Open Sans\", Arial, sans-serif; text-align: justify;\">Aenean fermentum odio eget quam ege