s</h2><p>Welcome to our website. These terms and conditions outline the rules and regulations for the use of our website.</p><h3>Intellectual Property Rights Terms and Conditions test</h3><p>Other than the content you own, under these Terms, we own all the intellectual property rights and materials contained in this Website.</p><h3>Restrictions</h3><p>You are specifically restricted from all of the following:</p><ol><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Publishing any Website material in any other media</li><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Selling, sublicensing and/or otherwise commercializing any Website material</li><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Using this Website in any way that is or may be damaging to this Website</li><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Using this Website in any way that impacts user access to this Website</li></ol><h3>Your Content</h3><p>In these Website Standard Terms and Conditions, \"Your Content\" shall mean any audio, video text, images or other material you choose to display on this Website.</p>','','','','','','','','','','','','','','','Terms and Conditions','Read our terms and conditions to understand the rules and regulations for using our website.','','','','','',NULL,'2025-09-04 08:33:36','2025-09-09 18:51:14'),(23,21,'en','Privacy Policy','','',NULL,NULL,NULL,'','<h1><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">PRIVACY STATEMENT</strong></h1><h3><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">SECTION 1 – WHAT DO WE DO WITH YOUR INFORMATION?</strong></h3><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">When you purchase something from our store, as part of the buying and selling process, we collect the personal information you give us such as your name, address and email address.</strong></p><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">When you browse our store, we also automatically receive your computer’s internet protocol (IP) address in order to provide us with information that helps us learn about your browser and operating system.</strong></p><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">Email marketing (if applicable): With your permission, we may send you emails about our store, new products and other updates.</strong></p><p><br></p><h3><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">SECTION 2 – CONSENT</strong></h3><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">How do you get my consent?</strong></p><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">When you provide us with personal information to complete a transaction, verify your credit card, place an order, arrange for a delivery or return a purchase, we imply that you consent to our collecting it and using it for that specific reason only.</strong></p><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">If we ask for your personal information for a secondary reason, like marketing, we will either ask you directly for your expressed consent, or provide you with an opportunity to say no.</strong></p><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">How do I withdraw my consent?</strong></p><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">If after you opt-in, you change your mind, you may withdraw your consent for us to contact you, for the continued collection, use or disclosure of your information, at any time, by contacting us at Grostore or mailing us at: info@thegrostore.in</strong></p><p><br></p><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">SECTION 3 – DISCLOSURE</strong></p><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">We may disclose your personal information if we are required by law to do so or if you violate our Terms of Service.</strong></p><p><br></p><h3><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">SECTION 4 – PAYMENT</strong></h3><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">We use Razorpay for processing payments. We/Razorpay do not store your card data on their servers. The data is encrypted through the Payment Card Industry Data Security Standard (PCI-DSS) when processing payment. Your purchase transaction data is only used as long as is necessary to complete your purchase transaction. After that is complete, your purchase transaction information is not saved.</strong></p><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">Our payment gateway adheres to the standards set by PCI-DSS as managed by the PCI Security Standards Council, which is a joint effort of brands like Visa, MasterCard, American Express and Discover.</strong></p><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">PCI-DSS requirements help ensure the secure handling of credit card information by our store and its service providers.</strong></p><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">For more insight, you may also want to read terms and conditions of Razorpay on </strong><a href=\"https://razorpay.com/?utm_source=chatgpt.com\" target=\"_blank\" style=\"background-color: transparent; color: rgb(17, 85, 204);\"><strong>https://razorpay.com</strong></a></p><p><br></p><h3><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">SECTION 5 – THIRD-PARTY SERVICES</strong></h3><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">In general, the third-party providers used by us will only collect, use and disclose your information to the extent necessary to allow them to perform the services they provide to us.</strong></p><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">However, certain third-party service providers, such as payment gateways and other payment transaction processors, have their own privacy policies in respect to the information we are required to provide to them for your purchase-related transactions.</strong></p><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">For these providers, we recommend that you read their privacy policies so you can understand the manner in which your personal information will be handled by these providers.</strong></p><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">In particular, remember that certain providers may be located in or have facilities that are located in a different jurisdiction than either you or us. So if you elect to proceed with a transaction that involves the services of a third-party service provider, then your information may become subject to the laws of the jurisdiction(s) in which that service provider or its facilities are located.</strong></p><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">Once you leave our store’s website or are redirected to a third-party website or application, you are no longer governed by this Privacy Policy or our website’s Terms of Service.</strong></p><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">Links</strong></p><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">When you click on links on our store, they may direct you away from our site. We are not responsible for the privacy practices of other sites and encourage you to read their privacy statements.</strong></p><p><br></p><h3><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">SECTION 6 – SECURITY</strong></h3><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">To protect your personal information, we take reasonable precautions and follow industry best practices to make sure it is not inappropriately lost, misused, accessed, disclosed, altered or destroyed.</strong></p><p><br></p><h3><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">SECTION 7 – COOKIES</strong></h3><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">We use cookies to maintain session of your user. It is not used to personally identify you on other websites.</strong></p><p><br></p><h3><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">SECTION 8 – AGE OF CONSENT</strong></h3><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">By using this site, you represent that you are at least the age of majority in your state or province of residence, or that you are the age of majority in your state or province of residence and you have given us your consent to allow any of your minor dependents to use this site.</strong></p><p><br></p><h3><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">SECTION 9 – CHANGES TO THIS PRIVACY POLICY</strong></h3><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">We reserve the right to modify this privacy policy at any time, so please review it frequently. Changes and clarifications will take effect immediately upon their posting on the website. If we make material changes to this policy, we will notify you here that it has been updated, so that you are aware of what information we collect, how we use it, and under what circumstances, if any, we use and/or disclose it.</strong></p><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">If our store is acquired or merged with another company, your information may be transferred to the new owners so that we may continue to sell products to you.</strong></p><p><br></p>','','','','','','','','','','','','','','','Privacy Policy','Privacy Policy','','','','','',NULL,'2025-09-04 08:33:36','2025-09-09 18:26:26'),(24,22,'en','Return Policy','','',NULL,NULL,NULL,'','<h1><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">Shipping &amp; Return</strong></h1><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">Effective Date: 11-04-2025</strong></p><p><br></p><p><br></p><h2><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">1. Shipping and Delivery:</strong></h2><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">1.1. Shipping: We aim to ship orders within the estimated time frames specified on our website. However, delivery times may vary based on factors beyond our control. Normally orders are shipped within 0-7 days or as per the delivery date agreed upon at the time of order confirmation, with delivery of the shipment subject to courier company/post office norms.</strong></p><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">1.2 Delivery: For domestic orders typically arrive within 1-15 working days or as per the delivery date agreed upon at the time of order confirmation. International delivery times vary but typically range from 5-20 working days, depending on the courier service and destination country.</strong></p><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">1.3 GROSTORE is not liable for any delay in delivery by the courier company/postal authorities and only guarantees to hand over the consignment to the courier company or postal authorities within 0-7 days from the date of the order and payment, or as per the delivery date agreed upon at the time of order confirmation.</strong></p><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">1.4. Shipping Address: Delivery of all orders will be made to the address provided by the buyer. Delivery of our services will be confirmed via your specified mobile number or WhatsApp during registration. Buyer responsible for providing the correct shipping address. GROSTORE is not responsible for items delivered to incorrect addresses provided by the customer.</strong></p><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">1.5. Courier Service: For international buyers, orders are shipped and delivered through registered international courier companies and/or International speed post only. For domestic buyers, orders are shipped through registered domestic courier companies and/or speed post only. Based on time and situation, different courier services may be used to ensure timely delivery.</strong></p><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">1.6 Delivery Charge: Delivery charge depends on the courier service and selected product; it will be displayed on the checkout screen.</strong></p><p><br></p><p><br></p><h2><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">2. Return and Refunds :</strong></h2><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">2.1. Returns: We strive to ensure the quality of our products. If you receive a damaged or incorrect item, please contact us within 3 days of receiving your order. Please note that since we provide art and craft-related products including resin materials, there will be no cancellation option available for orders unless the product is damaged or incorrect.</strong></p><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">2.2. Refunds: Refunds are granted at the discretion of GROSTORE. We offer replacements or refunds for items returned in accordance with our return policy. In the event of a damaged or incorrect product, as per our policy, we strive to fulfill the order by providing a replacement. If a replacement cannot be provided, we commit to issuing a refund within 7 working days.</strong></p><p><br></p>','','','','','','','','','','','','','','','Return Policy','Return policy','','Return policy','Return policy','Return policy','Return policy',NULL,'2025-09-09 18:28:10','2025-09-09 18:28:10');
