INSERT INTO `product_translations` VALUES (57,55,'3 Ply Mask For Resin Work',NULL,'<p>3 Ply Mask For Resin Work</p>','<p>3 Ply Mask For Resin Work</p>','','en','2025-09-03 18:34:04','2025-09-03 18:34:04'),(59,57,'Weighing Machine',NULL,'<p>This weighing machine is a high-precision tool that provides accurate measurements for a variety of items. It is designed with a durable and sleek design, making it a reliable addition to any home or business. The machine comes with a user-friendly interface and can weigh items up to 200 pounds. It is perfect for measuring food portions, packages, and other.</p>','<p><br></p>','','en','2025-09-03 19:26:41','2025-09-03 19:26:41'),(60,58,'Disposable Nitrite Gloves Pair For Resin Work',NULL,'<p>Disposable Nitrite Gloves Pair is a must-have tool for resin work. These gloves are designed to provide protection against chemicals and solvents commonly used in resin projects. They are made of high-quality nitrite material, ensuring durability and resistance to punctures and tears. The disposable nature of these gloves makes them convenient and hygienic for use in resin work</p><div><br></div>','<p><br></p>','','en','2025-09-03 19:29:20','2025-09-03 19:29:20'),(61,59,'Disposable Nitrite Gloves Pair For Resin Work',NULL,'<p>Disposable Nitrite Gloves Pair is a must-have tool for resin work. These gloves are designed to provide protection against chemicals and solvents commonly used in resin projects. They are made of high-quality nitrite material, ensuring durability and resistance to punctures and tears. The disposable nature of these gloves makes them convenient and hygienic for use in resin work</p><div><br></div>','<p><br></p>','','en','2025-09-03 19:32:09','2025-09-03 19:32:09'),(62,60,'Heat Blow Torch For Bubble Removal',NULL,'<p>A lightweight and easy-to-use heat torch designed for resin artists. Perfect for removing bubbles, creating smooth finishes, and adding professional effects to resin pours.</p><div><br></div>',NULL,'','en','202